import express from "express";
import db from "../models";
// import homeController from "../controllers/homeController";
import userController from "../controllers/userController";
const bodyParser = require("body-parser"); // Nếu bạn sử dụng body-parser

let router = express.Router();
router.use(express.json()); // Đảm bảo bạn đã sử dụng express.json() để phân tích JSON

let initWebRoutes = (app) => {
  //api backend
  // router.get("/", homeController.displayGetCRUD);

  // router.get("/create-crud", homeController.getCRUD);
  // router.post("/post-crud", homeController.postCRUD);
  // router.get("/get-crud", homeController.displayGetCRUD);
  // router.get("/edit-crud", homeController.getEditCRUD);

  // router.get("/delete-crud", homeController.getDeleteCRUD);
  // router.post("/put-crud", homeController.putCRUD);

  //api frontend
  router.get("/api/getAllProduct", userController.handleGetAllProduct);

  // router.post("/api/login", userController.handleLogin);
  app.post("/api/login", async (req, res) => {
    console.log(req.body); // Log dữ liệu để kiểm tra

    const { username, password } = req.body;
    const user = await db.User.findOne({
      where: {
        username: username,
        password: password,
      },
    });
    if (!user) {
      return res.status(401).send("Invalid username or password.");
    }

    res.json({ message: "Login successful!" }); // Return the token
  });

  // Route to get all blogs
  app.get("/api/blogs", async (req, res) => {
    console.log(req.body); // Log dữ liệu để kiểm tra

    const blogs = await db.Blogs.findAll();
    if (!blogs) {
      return res.status(401).send("Invalid username or password.");
    }

    // res.json({ message: "Welcome Blogs" }); // Return the token
    console.log(blogs);
    
    return res.status(200).json({
        errCode: 0,
        message: "Get all blog successful",
        blogs,
    });
  });

  // router.get("/api/get-users", userController.handleGetAllUser)
  // router.post("/api/create-user", userController.handleCreateUser)
  // router.put("/api/edit-user", userController.handleEditUser)
  // router.delete("/api/delete-user", userController.handleDeleteUser)

  // router.get("/api/allcode", userController.getAllCode);

  return app.use("/", router);
};

module.exports = initWebRoutes;

