        {
            title: DataTypes.STRING,
            author: DataTypes.TEXT,
            image_url: DataTypes.STRING,
            script: DataTypes.TEXT,
            numRatings: DataTypes.INTEGER,
            averageRating: DataTypes.INTEGER,
        },
        {
            sequelize,
            modelName: 'Blogs',
        }

    );
    return Blogs;
};

